import EmployeesListItem from '../employees-list-item/employees-list-item';

import './employees-list.css';

export const EmployeesList = ({ dataListEmployee }) => {
    return (
        <ul className="app-list list-group">
            {dataListEmployee.map(({ item }) => (
                <EmployeesListItem
                    key={item.id}
                    name={item.name}
                    salary={item.salary}
                />
            ))}
        </ul>
    );
};
